      | 34018 -> { ItemTypeData.id= 34018; name= "Women's 'Vise' Cybernetic Arm (black and orange ringed left)"; published= true; description= "The F-512.185 model 'Vise' Cybernetic Arm is the latest in naturalistic technologies that aim to enhance the human experience rather than cause - or worsen - a disconnect from reality. As such, its components have been carefully designed to ensure that they operate at a level of efficiency that is pleasing and empowering to the human mind, while not going too far beyond that level.    For instance, there are no unwieldy mechanical joints visible anywhere on the device. The shoulder is instead covered with a number of tiny clamps whose design conveys the sinuous curved lines of capsuleer beauty while simultaneously ensuring the shoulder has more than its full range of mobility. The elbow, likewise, appears more human than machine, thanks in good part to the superstrong stretchable material that covers it entirely in colors of deepest night. Moreover, some of the traditionally larger muscles have replaced by socketed metal pumps that are nested inside one another in concentric fashion, giving a slim and tight, yet powerful impression.    The hand on the Arm resembles a glove, and its delineated fingers in sunset orange are delicate enough to feel even the slightest change of pressure in the air. The hand's internal sensors render it so nimble that it can hold on to almost anything, even the slightest wisp of material, without leaving a mark; yet so strong that the only time its grip can be forced against the owner's will to open, the rest of its owner will long since have been separated from the Arm."; marketGroupId= Some(1836); groupId= 1271; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 0.100000 }; { DogmaAttributeValueData.attributeId = 162; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.500000 }; { DogmaAttributeValueData.attributeId = 1773; value= 3.000000 }; { DogmaAttrib